import React from "react";


export class Read extends React.Component{

    render(){
        return( // returns content for page
               <div>
                    <h3>Hello from read componet</h3>

                    <h3>{data.title}</h3>
                    <h3>{data.isbn}</h3>
                    <h3>{data.pageCount}</h3>
                    <img>{data.thumbnailUrl}</img>
                    <h3>{data.title}</h3>
               </div>
        );
    }
}
